      <h1>ol-ext: Crop filter</h1>
    </a>
    <div class="info">
      <i>ol.filter.Crop</i>
      crop a map or a layer using a feature area.
      <br />
      <i>ol.filter.Mask</i>
      mask a map or a layer using a feature area. You can choose the color of
      the mask.
    </div>
